  \"2016-11-25T21:06:02.749205\",\n\t\"name\": \"national-public-education-financial-survey-201011\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The National Public Education Financial
  Survey, 2010-11 (NPEFS 2010-11), is a study that is part of the Common Core of Data's
  National Public Education Financial Survey program; program data is available since
  1987 at <http://nces.ed.gov/ccd/stfis.asp>. CCD-NPEFS 2010-11 (http://nces.ed.gov/ccd/stfis.asp)
  is a cross-sectional survey that collected information about revenues and expenditures
  for public elementary and secondary education. The information is drawn from the
  state education agenciesufffd administrative records systems; no additional data
  are collected from schools or districts. NPEFS data are used in calculating statesufffd
  Title I grants. The study was conducted using responding agencies' existing administrative
  records. The universe of state education agencies was sampled.  The study's response
  rate has not been calculated as of May 2013.  Key statistics produced from CCD-NPEFS
  2010-11 are on revenues by source and expenditures by function and object.  Average
  daily attendance is also collected on the NPEFS.\",\n\t\"license_title\": \"Creative
